require 'spec_helper'

describe Drawing do
  describe "attributes" do
    it { should validate_presence_of(:subscription_id) }
    it { should validate_presence_of(:canvas) }

    it { should belong_to(:subscription) }
    it { should_not allow_mass_assignment_of(:subscription_id) }
  end

  describe "self.blank_canvas" do
    it "should open the public image for blank canvas" do
      Drawing.blank_canvas.include? File.open(Rails.root.join("public", "empty_canvas.png"))
    end
  end

  describe "generate_image_from_canvas!" do
    let(:subscription) { create(:basic_subscription) }

    it "creates an image from a base64 string" do
      whiteboard = subscription.drawings.new
      whiteboard.canvas.should be_blank

      image_data = "data:image/png;base64,"
      whiteboard.generate_image_from_canvas!(image_data)

      whiteboard.canvas.should be_present
    end
  end
end